import React from 'react';
import styles from './Title.module.css';

const Title =()=>(
    <React.Fragment>
        <div className={styles.W}></div>
        <div className={styles.A}></div>
        <div className={styles.R}></div>
    </React.Fragment>
);
export default Title;
